import "./styles.css";
import  data from "./demo-data.json";

export default function App() {
  const Wrapper = ({ property, children }: { property:string, children: any }) => {
    return (
      <div className="indented">
      <span className="clickable-property key">{property}</span>
      {children};
    </div>
    )
  };

  const iterateObject = (object: any): any => {
    return Object.keys(object).map((key) => {
      switch (typeof object[key]) {
        case "string":
          return (
              <Wrapper key={key} property={key}>
                {`"${object[key]}"`}
              </Wrapper>
          );
        case "boolean":
          return               <Wrapper key={key}>
            {object[key].toString()}
          </Wrapper>

        default:
          if (Array.isArray(object[key])) {
            return               <Wrapper key={key}>
              [
                            {object[key].map((elem:any) => {iterateObject(elem)})}
                          ],
            </Wrapper>

          } else {
            return              <Wrapper key={key}>

              &#123;
              {iterateObject(object[key])}
              &#125;
            </Wrapper>

          }
      }
    });
  };

  return (
    <div className="App">
      <div>
        <label htmlFor="property-input">Property</label>
        <input type="text" id="property-input" />
      </div>

      <div>
        Response
        <div>{iterateObject(data)}</div>
        {/* <div>
          <pre>{JSON.stringify(data, null, 2)}</pre>
        </div>
        ;{" "} */}
      </div>
    </div>
  );
}
